import React from "react";
import "./Dialogs.css"
import Message from "./Dialog/Message";
import { NavLink } from "react-router-dom";
import DialogItem from "./DialogsItems/DialogsItem";

let dialogNames=[
    {name: "Владимир", id: "1"},
    {name: "Мария", id: "2"},
    {name: "Михаил", id: "3"},
    {name: "Вячеслав", id: "4"},  
    {name: "Алексей", id: "5"}, 
]

let messages=[
    {message: "Привет. Как дела?", id: "1"},
    {message: "Здравствуйте.", id: "2"},
    {message: "Здарова. Пойдешь гулять?", id: "3"},
    {message: "Привет. Ты вечером свободен?", id: "4"},
]

function Dialogs(){
    return(
        <div className="dialogs">
            <div className="dialog-user">
                {
                    dialogNames.map((object)=><DialogItem name={object.name} id={object.id}/>)
                }
            </div>
            <div className="dialog-text">
                <Message  message={messages[0].message} id={messages[0].id}/>
                <Message  message={messages[1].message} id={messages[1].id}/>
                <Message  message={messages[2].message} id={messages[2].id}/>
                <Message  message={messages[3].message} id={messages[3].id}/>
            </div>
        </div>
    )
}

export default Dialogs
